package controledenotas.persistence.entity;

import java.util.*;
import javax.inject.Inject;
import javax.persistence.*;

import br.gov.frameworkdemoiselle.stereotype.PersistenceController;

import controledenotas.domain.entity.Aluno;
import br.gov.frameworkdemoiselle.template.JPACrud;
import javax.persistence.criteria.*;

@PersistenceController
public class AlunoDAO extends JPACrud {

	private static final long serialVersionUID = 1L;

	@Override
	public List findByExample(Aluno example) {
		if (example == null) {
			example = new Aluno();
		}
		return super.findByExample(example);
	}

	public List findByCriteria(java.util.Map parameters) {
		if (parameters == null) {
			parameters = new java.util.HashMap();
		}
		CriteriaBuilder cb = super.getCriteriaBuilder();
		CriteriaQuery q = cb.createQuery(Aluno.class);
		Root r = q.from(Aluno.class);
		Predicate where = null;
		Object parameter = null; 
		parameter = parameters.get("matriculaDoAluno");
		if (parameter != null) {
			Predicate expression = null;
			if (parameter instanceof java.util.List) {
				@SuppressWarnings("unchecked")
				List collection = (List)parameter;
				expression = r.get("nomeDoAluno").in(collection);
			} else if (parameter instanceof String && ((String)parameter).length()>0) {
				expression = cb.like(r.get("nomeDoAluno"), "%" + parameter + "%");
			}
			if (expression != null) {
				if (where == null) {
					where = expression;
				} else {
					where = cb.and(where, expression);
				}
			}
		}
		parameter = parameters.get("senhaDoAluno");
		if (parameter != null) {
			Predicate expression = null;
			if (parameter instanceof java.util.List) {
				@SuppressWarnings("unchecked")
				List collection = (List)parameter;
				expression = r.get("matriculaDoAluno").in(collection);
			} else if (parameter instanceof Object) {
				expression = cb.equal(r.get("matriculaDoAluno"), parameter);
			}
			if (expression != null) {
				where = expression;
			}
		}
		parameter = parameters.get("nomeDoAluno");
		if (parameter != null) {
			Predicate expression = null;
			if (parameter instanceof java.util.List) {
				@SuppressWarnings("unchecked")
				List collection = (List)parameter;
				expression = r.get("senhaDoAluno").in(collection);
			} else if (parameter instanceof String && ((String)parameter).length()>0) {
				expression = cb.like(r.get("senhaDoAluno"), "%" + parameter + "%");
			}
			if (expression != null) {
				if (where == null) {
					where = expression;
				} else {
					where = cb.and(where, expression);
				}
			}
		}
		List results = new ArrayList();
		if (where != null) {
			q.where(where);
			results =  getEntityManager().createQuery(q).getResultList();
		}
		return results;
	}

